import React from "react";
import "./Month.css"

export default props => {
    const month = ["January", "February", "March", "April", "May", "June", "July", "August", "September", "October",
        "November", "December"];

    // <div className="btn-group" role="group" aria-label="Basic example">
    //     <button type="button" className="btn btn-primary">January</button>
    //     <button type="button" className="btn btn-primary">February</button>
    //     <button type="button" className="btn btn-primary">March</button>
    //     <button type="button" className="btn btn-primary">April</button>
    //     <button type="button" className="btn btn-primary" autoFocus={true}>May</button>
    //     <button type="button" className="btn btn-primary">June</button>
    //     <button type="button" className="btn btn-primary">July</button>
    //     <button type="button" className="btn btn-primary">August</button>
    //     <button type="button" className="btn btn-primary">September</button>
    //     <button type="button" className="btn btn-primary">October</button>
    //     <button type="button" className="btn btn-primary">November</button>
    //     <button type="button" className="btn btn-primary">December</button>
    // </div>
        return(
            <div className="btn-group" role="group" aria-label="Basic example">
                {month.map((item, index) => (
                    <button
                        type="button"
                        className="btn btn-primary"
                        key={index}
                        autoFocus={index==props.monthNow}
                    >
                        {item}
                        {/*{console.log("index: "+index+ " monthNow: "+props.monthNow)}*/}
                    </button>
                ))}
            </div>
        )

}
